import React from 'react';
import '../styles/Lesson-style.css';
import CodeExecutor from '../components/CodeExecutor';


const OperatorsAndExpressions = () => {
  return (
    <div className="lesson-container">
      <div className="lesson-header">
        <h1>Операторы и выражения в Python</h1>
      </div>

      <div className="lesson-section">
        <h2>Арифметические операторы</h2>
        <p>
          Арифметические операторы используются для выполнения основных математических операций:
        </p>
        <ul>
          <li><code>+</code> - сложение</li>
          <li><code>-</code> - вычитание</li>
          <li><code>*</code> - умножение</li>
          <li><code>/</code> - деление</li>
          <li><code>%</code> - остаток от деления</li>
          <li><code>**</code> - возведение в степень</li>
          <li><code>//</code> - целочисленное деление</li>
        </ul>
        <pre>
          <code>
            {`# Примеры использования арифметических операторов\n`}
            {`a = 10\n`}
            {`b = 3\n`}
            {`print(a + b)  # Вывод: 13\n`}
            {`print(a - b)  # Вывод: 7\n`}
            {`print(a * b)  # Вывод: 30\n`}
            {`print(a / b)  # Вывод: 3.3333333333333335\n`}
            {`print(a % b)  # Вывод: 1\n`}
            {`print(a ** b) # Вывод: 1000\n`}
            {`print(a // b) # Вывод: 3\n`}
          </code>
        </pre>
      </div>

      <div className="lesson-section">
        <h2>Логические операторы</h2>
        <p>
          Логические операторы используются для выполнения логических операций:
        </p>
        <ul>
          <li><code>and</code> - логическое И</li>
          <li><code>or</code> - логическое ИЛИ</li>
          <li><code>not</code> - логическое НЕ</li>
        </ul>
        <pre>
          <code>
            {`# Примеры использования логических операторов\n`}
            {`x = True\n`}
            {`y = False\n`}
            {`print(x and y)  # Вывод: False\n`}
            {`print(x or y)   # Вывод: True\n`}
            {`print(not x)    # Вывод: False\n`}
          </code>
        </pre>
      </div>

      <div className="lesson-section">
        <h2>Операторы сравнения</h2>
        <p>
          Операторы сравнения используются для сравнения значений:
        </p>
        <ul>
          <li><code>==</code> - равно</li>
          <li><code>!=</code> - не равно</li>
          <li><code>></code> - больше</li>
          <li><code>&lt;</code> - меньше</li>
          <li><code>>=</code> - больше или равно</li>
          <li><code>&lt;=</code> - меньше или равно</li>
        </ul>
        <pre>
          <code>
            {`# Примеры использования операторов сравнения\n`}
            {`a = 5\n`}
            {`b = 10\n`}
            {`print(a == b)  # Вывод: False\n`}
            {`print(a != b)  # Вывод: True\n`}
            {`print(a > b)   # Вывод: False\n`}
            {`print(a < b)   # Вывод: True\n`}
            {`print(a >= b)  # Вывод: False\n`}
            {`print(a <= b)  # Вывод: True\n`}
          </code>
        </pre>
      </div>

      <div className="lesson-section">
          <h2>Операторы присваивания</h2>
          <p>
            Операторы присваивания используются для присваивания значений переменным:
          </p>
          <ul>
            <li><code>=</code> - присваивание</li>
            <li><code>+=</code> - присваивание с сложением</li>
            <li><code>-=</code> - присваивание с вычитанием</li>
            <li><code>*=</code> - присваивание с умножением</li>
            <li><code>/=</code> - присваивание с делением</li>
            <li><code>%=</code> - присваивание с остатком от деления</li>
            <li><code>**=</code> - присваивание с возведением в степень</li>
            <li><code>//=</code> - присваивание с целочисленным делением</li>
          </ul>
          <pre>
            <code>
              {`# Примеры использования операторов присваивания\n`}
              {`a = 5\n`}
              {`a += 2  # эквивалентно a = a + 2\n`}
              {`print(a)  # Вывод: 7\n`}
              {`a -= 1  # эквивалентно a = a - 1\n`}
              {`print(a)  # Вывод: 6\n`}
              {`a *= 3  # эквивалентно a = a * 3\n`}
              {`print(a)  # Вывод: 18\n`}
              {`a /= 2  # эквивалентно a = a / 2\n`}
              {`print(a)  # Вывод: 9.0\n`}
              {`a %= 4  # эквивалентно a = a % 4\n`}
              {`print(a)  # Вывод: 1.0\n`}
              {`a **= 3  # эквивалентно a = a ** 3\n`}
              {`print(a)  # Вывод: 1.0\n`}
              {`a //= 2  # эквивалентно a = a // 2\n`}
              {`print(a)  # Вывод: 0.0\n`}
            </code>
          </pre>
      </div>

      <div className="lesson-footer">
        <p>
          Операторы и выражения в Python позволяют выполнять различные операции с данными и являются основой для построения логики программы. Понимание и правильное использование операторов поможет вам писать более эффективный и читаемый код.
        </p>
      </div>
    </div>
);
};

export default OperatorsAndExpressions;
